package song.common.result;import java.util.List;import java.util.Map;/** * description: * author:          song * createDate:      2018/4/18 */public class GridMapResult {    private long total;    private List<Map<String,Object>> rows;    public long getTotal() {        return total;    }    public void setTotal(long total) {        this.total = total;    }    public List<Map<String, Object>> getRows() {        return rows;    }    public void setRows(List<Map<String, Object>> rows) {        this.rows = rows;    }    public GridMapResult() {    }    public GridMapResult(long total, List<Map<String, Object>> rows) {        this.total = total;        this.rows = rows;    }}